Create a new file `server.js`:
```javascript
const express = require('express');
const app = express();

app.use(express.json());

const dummyData = [
  { id: 1, name: 'John Doe', email: 'john.doe@example.com' },
  { id: 2, name: 'Jane Doe', email: 'jane.doe@example.com' },
];

app.get('/api/data', (req, res) => {
  res.json(dummyData);
});

app.post('/api/data', (req, res) => {
  const { name, email } = req.body;
  const newData = { id: dummyData.length + 1, name, email };
  dummyData.push(newData);
  res.json(newData);
});

app.listen(3001, () => {
  console.log('Server listening on port 3001');
});
```
**Frontend (React App) - API Calls**

Create a new file `api.js` in the `src` directory:
```javascript
import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:3001/api',
});

export const getData = async () => {
  const response = await api.get('/data');
  return response.data;
};

export const postData = async (data) => {
  const response = await api.post('/data', data);
  return response.data;
};
```
**Frontend (React App) - Components**

Create a new file `App.js` in the `src` directory:
```javascript
import React, { useState, useEffect } from 'react';
import { getData, postData } from './api';

function App() {
  const [data, setData] = useState([]);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      const data = await getData();
      setData(data);
    };
    fetchData();
  }, []);

  const handleSubmit = async (event) => {
    event.preventDefault();
    const newData = await postData({ name, email });
    setData([...data, newData]);
    setName('');
    setEmail('');
  };

  return (
    <div>
      <h1>Dummy Data App</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={name}
          onChange={(event) => setName(event.target.value)}
          placeholder="Name"
        />
        <input
          type="email"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
          placeholder="Email"
        />
        <button type="submit">Add Data</button>
      </form>
      <ul>
        {data.map((item) => (
          <li key={item.id}>
            {item.name} - {item.email}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
```
